var delag = function(f) {
    delag.stripDetection = delag.stripDetection || function(s) {
        var outLines = [];
        var lines = s.split("\n");
        for (var i = 0; i < lines.length; i++) {
            if (!lines[i].includes("KAInfiniteLoopProtect")) {
                outLines.push(lines[i]);
            }
        }
        return outLines.join("\n");
    }
    ;
    var str = delag.stripDetection(f.toString());
    /* Copied from Element118 delag() function: */
    return Object.constructor('return (function(__env__) {return ' + str + ';});')()(this);
};

function openWin(url, width, height) {
    var leftPosition, topPosition;
    //Allow for borders.
    leftPosition = (window.screen.width / 2) - ((width / 2) + 10);
    //Allow for title and status bars.
    topPosition = (window.screen.height / 2) - ((height / 2) + 50);
    //Open the window.
    window.open(url, "Error Page", "status=no,height=" + height + ",width=" + width + ",resizable=yes,left=" + leftPosition + ",top=" + topPosition + ",screenX=" + leftPosition + ",screenY=" + topPosition + ",toolbar=no,menubar=no,scrollbars=no,location=no");
}

