function runCommand(command, element) {
    element.remove();
    screen = "play";
    var commandParse = command.split("");
    if(commandParse[0] == commandPrefix){
        commandParse.shift();
        commandParse = commandParse.join("");
        commandParse = commandParse.split(" ");
        var commandCheckName = false;
        var commandInfo;
        for(var commandCheck = 0; commandCheck < commands.length; commandCheck++){
            if(commands[commandCheck].name == commandParse[0]){
                commandCheckName = true;
                commandInfo = commands[commandCheck];
            }
        }
        if(commandCheckName){
            var commandScript = commandInfo.script;
            if(commandInfo.parameters.length > 0){
                commandParse.shift();
                var commandParams = commandInfo.parameters;
                    for(var commandParam = 0; commandParam < commandInfo.parameters; commandParam++){
                        commandParams[commandParam] = "$" + commandParams[commandParam];
                    }
                for(var commandVarReplace = 0; commandVarReplace < commandParams.length; commandVarReplace++){
                    /*while(commandScript.includes(commandParams[commandVarReplace])){
                        commandScript.replace(commandParams[commandVarReplace], "'" + commandParse[commandVarReplace] + "'");
                    }*/
                    var commandScriptReplace = "('" + commandScript + "')";
                    commandScript = eval(`${commandScriptReplace}.replace(/\\\$${commandInfo.parameters[commandVarReplace]}/g,'"' + ${commandParse[commandVarReplace]} + '"')`);
                }
                console.log(commandScript);
                eval(commandScript);
                //return commandScript;
            }else{
                return commandInfo.script;
            }
        }
    }else{
        return "Error, command not found";
    }
}
