    function mmoved(e) {
        p.rx -= e.movementY / 300;
        p.ry += e.movementX / 300;

        while (p.ry > Math.PI * 2) {
            p.ry -= Math.PI * 2;
        }
        while (p.ry < 0) {
            p.ry += Math.PI * 2;
        }
        if (p.rx > Math.PI / 2) {
            p.rx = Math.PI / 2;
        }
        if (p.rx < -Math.PI / 2) {
            p.rx = -Math.PI / 2;
        }
    }
