    doc.onkeydown = function(e) {
        if (e.repeat) {
            return;
        }
        var k = e.key.toLowerCase();
        Key[k] = true;
        if (k === "delete" && screen == "play") {
            initEverything();
            releasePointer();
        }

        if (k === "t" && debug && screen=="play") {
            initTextures();
        }
        if (screen === "play" && !document.getElementsByClassName("commandInput").style) {
            if (k === "p" || k == "escape") {
                if(!debug && k == "escape"){
                    releasePointer();
                    screen = "pause";
                }else if(debug && k === "p"){
                    autoPause = !autoPause;
                }
            }

            if (k === "b" && screen == "play") {
                p.autoBreak = !p.autoBreak;
            }

            if (k === " " && screen === "play" && !document.getElementsByClassName("commandInput").style) {
                if (Date.now() < p.lastJump + 400) {
                    p.flying ^= true;
                } else {
                    p.lastJump = Date.now();
                }
            }

            if (k === "z") {
                FOV(10);
            }

            if (k === "x") {
                //Quake Professional lol
                FOV(110);
            }

            if (k === "e") {
                screen = "inventory";
                releasePointer();
            }

            if (k === ";") {
                releasePointer();
                // ctx.clearRect(0, 0, canvas.width, canvas.height);
                // ctx.drawImage(gl.canvas, 0, 0);
                // hud();
                // updateHUD = false;
                freezeFrame = true;
                // analytics.lastUpdate = Date.now() + 10000;
            }

            if (Number(k)) {
                window.inventory.hotbarSlot = Number(k) - 1;
                holding = window.inventory.hotbar[window.inventory.hotbarSlot].id;
                updateHUD = true;
            }
        } else if (screen.includes("pause")) {
            if ((k === "p" || k == "escape") && Date.now() > unpauseDelay) {
                screen = "play";
                play();
            }
        } else if (screen === "inventory" || screen === "command") {
            if (k === "e" || k == "escape") {
                screen = "play";
                play();
            }
        }

    }
