        analytics.frames++;
        analytics.totalFrameTime += win.performance.now() - frameStart;
        analytics.worstFrameTime = Math.max(win.performance.now() - frameStart, analytics.worstFrameTime);
        window.parent.raf = window.requestAnimationFrame(gameLoop);
